import React, { useEffect, useState } from 'react';
import Style from '../Openings/Openings.module.css';
import { Heading } from '../Heading/Heading';

export const Openings = () => {
  const [openingsJson, setOpeningsJson] = useState([]);
  const [selectedOpeningIndex, setSelectedOpeningIndex] = useState(null);
  const [viewDetails, setViewDetails] = useState(false);
  const [showApplicants, setShowApplicants] = useState(false);

  const fetchCallForOpenings = () => {
    fetch("http://localhost:8080/JobVista/GetOpenings", {
      method: 'POST',
      headers: {
        'Content-type': 'Application/JSON'
      },
      body: JSON.stringify({'userDetails':JSON.parse(localStorage.getItem('userDetails'))})

    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        setOpeningsJson(result.Value);
        console.log("re: " , result.Value);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  useEffect(() => {
    fetchCallForOpenings();
  }, []);

  const handleOpeningClick = (index) => {
    setSelectedOpeningIndex(index);
    setViewDetails(true);
  }

  const handleTestClick = () => {
    setShowApplicants(true);
  }

  const handleBackClick = () => {
    setShowApplicants(false);
  }

  return (
    <div>
      {!viewDetails && openingsJson && (
        <div id={Style.applicants}>
          <Heading>Openings</Heading>
          <table>
            <thead>
              <tr className={Style.openingTr}>
                <th>Opening Name</th>
                <th>Qualification</th>
                <th>Experience</th>
                <th>Employment Type</th>
                <th>Salary Range</th>
                <th>Start Date</th>
                <th>End Date</th>
                <th>Department Name</th>
              </tr>
            </thead>
            <tbody>
              {openingsJson.map((item, index) => (
                <tr key={index} onClick={() => handleOpeningClick(index)}>
                  <td>{item.Opening.description}</td>
                  <td>{item.Opening.qualification}</td>
                  <td>{item.Opening.experience}</td>
                  <td>{item.Opening.employmentType}</td>
                  <td>{item.Opening.salaryRange}</td>
                  <td>{item.Opening.startDate}</td>
                  <td>{item.Opening.endDate}</td>
                  <td>{item.Opening.departments}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {viewDetails && selectedOpeningIndex !== null && !showApplicants && (
        <div id={Style.openingId}>
          <div className={Style.applicantDiv}>
            <Heading className={Style.title}>
              <i onClick={() => setViewDetails(false)} className="fa-regular fa-circle-left"></i>Tests
            </Heading>
            <table>
              <thead>
                <tr className={Style.openingTr}>
                  <th>Test Title</th>
                  <th>Date</th>
                  <th>Duration</th>
                </tr>
              </thead>
              <tbody>
                {openingsJson[selectedOpeningIndex].Tests && Object.keys(openingsJson[selectedOpeningIndex].Tests).length > 0 ? (
                  <tr onClick={handleTestClick} className={Style.openingTr}>
                    <td>{openingsJson[selectedOpeningIndex].Tests.testTitle}</td>
                    <td>{openingsJson[selectedOpeningIndex].Tests.testDate}</td>
                    <td>{openingsJson[selectedOpeningIndex].Tests.testDuration}</td>
                  </tr>
                ) : (
                  <tr>
                    <td onClick={handleTestClick} colSpan="3">No tests available</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
          <div className={Style.applicantDiv}>
            <Heading className={Style.title}>
              Panelists
            </Heading>
            <table>
              <thead>
                <tr className={Style.openingTr}>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Position</th>
                  <th>Gender</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>{openingsJson[selectedOpeningIndex].PanelistsinOpening.panelistName}</td>
                  <td>{openingsJson[selectedOpeningIndex].PanelistsinOpening.panelistEmail}</td>
                  <td>{openingsJson[selectedOpeningIndex].PanelistsinOpening.panelistPosition}</td>
                  <td>{openingsJson[selectedOpeningIndex].PanelistsinOpening.panelistGender}</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      )}

      {viewDetails && selectedOpeningIndex !== null && showApplicants && (
        <div>
          <div id={Style.applicantDiv}>
            <Heading className={Style.title}>
              <i onClick={handleBackClick} className="fa-regular fa-circle-left"></i>Applicants
            </Heading>
          </div>
          <table>
            <thead>
              <tr className={Style.openingTr}>
                <th>Name</th>
                <th>Email</th>
                <th>Gender</th>
                <th>DOB</th>
                <th>Qualification</th>
                <th>Phone</th>
                <th>Experience</th>
                <th>Application Id</th>
              </tr>
            </thead>
            <tbody>
              {openingsJson[selectedOpeningIndex].Applicants.length > 0 ? (
                openingsJson[selectedOpeningIndex].Applicants[0].map((applicant, index) => (
                  <tr key={index}>
                    <td>{applicant.jobSeekerName}</td>
                    <td>{applicant.jobSeekerEmail}</td>
                    <td>{applicant.jobSeekerGender}</td>
                    <td>{applicant.jobSeekerDOB}</td>
                    <td>{applicant.jobSeekerQualification}</td>
                    <td>{applicant.jobSeekerPhone}</td>
                    <td>{applicant.jobSeekerExperience}</td>
                    <td>{applicant.applicationId}</td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="8">No applicants</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      )}

    </div>
  );
}
